$(document).ready(function(){$(".carousel").carousel();let n=n=>n.trim().length===0?undefined:n,t=new Vue({el:"#tabContent",data:{categoriesPageCount:1},mounted:function(){this.categoriesCallback(1);$(".onChangeCallback").change(()=>this.categoriesCallback(1));$("#searchInput").keypress(this.searchCallback)},methods:{categoriesCallback:function(t){let i=this;axios.get(util.apiUrl("/api/getQuizList",{page:t,size:global.quizCardAmount,type:"category",difficulty:$("#difficultySelect option:selected").attr("value"),categoryIndex:$("#categorySelect option:selected").attr("value"),orderBy:$("#orderBySelect option:selected").attr("value"),search:n($("#searchInput").val())})).then(function(n){let t=i.renderList("#categoriesList",n.data);t>1&&(i.categoriesPageCount=t)})},searchCallback:function(n){n.keyCode===13&&this.categoriesCallback(1)},renderList:function(n,t){$(n).empty();let i=$(n).html(t);return parseInt($(i.find(".totalPages")[0]).attr("amount"))}}})});